(function() {

	var URLTracking = {

		holdEvents: [],

		trackedEvents: {},

		trackedEventsGlobal: {},

		trackedEventsLibrary: {},

		distinctId: Date.now(),

		init: function() {

			Broadcast.once('MRAID Viewable', function() {

				if (URLTracking.holdEvents.length > 0) {

					for (var i=0; URLTracking.holdEvents[i]; i++) URLTracking.sendAction(URLTracking.holdEvents[i][0], URLTracking.holdEvents[i][1], URLTracking.holdEvents[i][2]);

					URLTracking.holdEvents = [];

				}

			}, "release-integration-script-1");

			for (var i=0; Settings["track-events"][i]; i++) {

				(function(eventName) {

					if (MRAID && MRAID.TrackedEvents[eventName]) {

						URLTracking.trackAction(eventName, true);

					} else {

						Broadcast.on(eventName, function() {

							URLTracking.trackAction(eventName);

						}, "release-integration-script-1");

					}

				})(Settings["track-events"][i].name);

			}

		},

		trackAction: function(eventName, force) {

			force = force || false;

			if (Settings["track-url-actions"] && eventName in Settings["track-url-actions"]) {

				for (var i=0; Settings["track-url-actions"][eventName][i]; i++) {

					if (!URLTracking.trackedEvents[eventName] || Settings["track-url-actions"][eventName][i].trackMultiple || force) {

						if (MRAID.isViewable || Settings["track-events-on-viewable"] === false) {

							URLTracking.sendAction(eventName, Settings["track-url-actions"][eventName][i]);

						} else {

							URLTracking.holdEvents.push([eventName, Settings["track-url-actions"][eventName][i]]);

						}

					}

				}

				URLTracking.trackedEvents[eventName] = true;

			}

			if (Settings["track-url-global"]) {

				if (!URLTracking.trackedEventsGlobal[eventName] || !Settings["track-url-global-only-first"] || force) {

					if (MRAID.isViewable || Settings["track-events-on-viewable"] === false) {

						URLTracking.sendAction(eventName, {url: Settings["track-url-global"], trackingType: Settings["track-url-global-type"], trackMultiple: !Settings["track-url-global-only-first"]});

					} else {

						URLTracking.holdEvents.push([eventName, {url: Settings["track-url-global"], trackingType: Settings["track-url-global-type"], trackMultiple: !Settings["track-url-global-only-first"]}]);

					}

				}

				URLTracking.trackedEventsGlobal[eventName] = true;

			}

			if (Settings["track-libraries"] && eventName in Settings["track-libraries"]) {

				for (var i=0; Settings["track-libraries"][eventName][i]; i++) {

					if (!URLTracking.trackedEventsLibrary[eventName] || Settings["track-libraries"][eventName][i].trackMultiple || force) {

						if (MRAID.isViewable || Settings["track-events-on-viewable"] === false) {

							URLTracking.sendAction(eventName, Settings["track-libraries"][eventName][i]);

						} else {

							URLTracking.holdEvents.push([eventName, Settings["track-libraries"][eventName][i]]);

						}

					}

				}

				URLTracking.trackedEventsLibrary[eventName] = true;

			}

		},

		sendAction: function(eventName, urlObject) {

			if (this.sendActionParamsHook) {

				var resultParams = this.sendActionParamsHook(eventName, urlObject);

				eventName = resultParams.eventName;
				urlObject = resultParams.urlObject;

			}

			if (urlObject && urlObject.url) {

				if (urlObject.trackingType === 'xhr') {

					MRAID.log('URL Tracker (xhr):', eventName, '###', urlObject.url);

					var xhr = new XMLHttpRequest();

					xhr.open('GET', URLTracking.transformUrl(urlObject.url, eventName), true);

					xhr.send();

				} else if (urlObject.trackingType === 'img') {

					MRAID.log('URL Tracker (img):', eventName, '###', urlObject.url);

					var img = new Image();

					img.src = URLTracking.transformUrl(urlObject.url, eventName);

				} else if (urlObject.trackingType === 'script') {

					MRAID.log('URL Tracker (script):', eventName, '###', urlObject.url);

					var scr = document.createElement('script');

					scr.type = 'text/javascript';

					scr.src = URLTracking.transformUrl(urlObject.url, eventName);

					document.body.appendChild(scr);

				}

			} else if (urlObject && urlObject.call) {

				MRAID.log('Library Tracker:', eventName, '###', urlObject.call, urlObject.params);

				var path = urlObject.call.split('.');

				var fn = window,
					context = window;

				for (var i=0; path[i]; i++) {

					if (i > 0) context = context[path[i-1]];

					fn = fn[path[i]];

					if (!fn) break;

				}

				if (!fn) return;

				if (typeof fn === 'function') fn.apply(context, urlObject.params || []);

			}

		},

		//This method can be overwritten in release js code
		sendActionParamsHook: function(eventName, urlObject) {

			return {
				eventName: eventName,
				urlObject: urlObject
			};

		},

		transformUrl: function(url, eventName) {

			url = url
				.replace(new RegExp('\\[timestamp\\]', "ig"), Date.now())
				.replace(new RegExp('\\[event-name\\]', "ig"), encodeURIComponent(eventName))
				.replace(new RegExp('\\[os\\]', "ig"), MRAID.ios ? 'ios' : (MRAID.android ? 'android' : ''));

			for (var settingCodename in Settings) {

				if (Settings.hasOwnProperty(settingCodename)) {

					if (url.indexOf('['+settingCodename+']') > -1) {

						url = url
							.replace(new RegExp('\\['+settingCodename+'\\]', "ig"), encodeURIComponent(Settings[settingCodename]));

					}

				}

			}

			return url;

		}

	};

	URLTracking.init();

	//Provide possibility to add hooks
	window.URLTracking = URLTracking;

})();

(function() {

	Broadcast.on("Interaction", function() {

		var ctaOnClicks = parseInt(Settings["cta-on-clicks"]);

		if (ctaOnClicks > 0 && MRAID.Interactions >= ctaOnClicks) {

			if (App && App.Gameplay && App.Gameplay.transferToCTA) {

				App.Gameplay.transferToCTA('cta clicks', 200);

				MRAID.CtaClicksComplete = true;

				Broadcast.call("Cta clicks complete");

			}

		}

	}, "release-integration-script-2");

	Broadcast.on("Creative Showed", function() {

		//переопределяем значение дефотных настроек кнопки закрытия

		if (Settings['close-button-color-styles']) MRAID.setCloseButtonStyles('close-button-color-styles', Settings['close-button-color-styles']);
		if (Settings['close-button-bar-color-styles']) MRAID.setCloseButtonStyles('close-button-bar-color-styles', Settings['close-button-bar-color-styles']);
		if (Settings['close-button-timer-color-styles']) MRAID.setCloseButtonStyles('close-button-timer-color-styles', Settings['close-button-timer-color-styles']);

	}, "release-integration-script-2");

	MRAID.setCloseButtonStyles = function(name, value) {

		var base_names = ['close-button-styles', 'close-button-timer-styles', 'close-button-bar-styles'];

		name = base_names[['close-button-color-styles', 'close-button-timer-color-styles', 'close-button-bar-color-styles'].indexOf(name)];

		Settings[name] = value;

		var close_button = document.querySelector('.mraid-close-button');

		if (close_button && Settings[name] && name === 'close-button-styles' && Settings.Assets['close-button']) {

			if (close_button.style.backgroundImage) close_button.style.backgroundImage = '';

			Settings[name]['mask-image'] = 'url(' + Settings.Assets['close-button'].url + ')';
			Settings[name]['-webkit-mask-image'] = 'url(' + Settings.Assets['close-button'].url + ')';

			MRAID.extendStyles(close_button, Settings[name]);

		} else if (document.querySelector('.mraid-close-button-timer') && Settings[name] && name === 'close-button-timer-styles') {

			MRAID.extendStyles(document.querySelector('.mraid-close-button-timer'), Settings[name]);

		} else if (close_button && Settings[name] && name === 'close-button-bar-styles') {

			if (Settings["interstitial-timeout"] && MRAID.progressBar) {

				var bar_time = MRAID.progressBar.value();

				MRAID.progressBar.destroy();
				MRAID.progressBar = null;

				var bar_styles = {
					strokeWidth: 6,
					color: '#FFF',
					trailColor: '#eee',
					trailWidth: 1,
					svgStyle: null
				};

				MRAID.extend(bar_styles, Settings[name]);

				MRAID.progressBar = new ProgressBar.Circle(document.querySelector('.mraid-close-button-container'), bar_styles);

				MRAID.progressBar.set(bar_time);

				MRAID.progressBar.animate(1.0, {
					duration: Settings["interstitial-timeout"] - (Settings["interstitial-timeout"] * bar_time)
				}, function() {

					clearInterval(MRAID.updateTimeInterval);

					document.querySelector('.mraid-close-button-timer').remove();

					MRAID.showCloseButton();

				});

			}

		}

	};

})();

(function() {

	//2022.01.10 replace new target-url object format to single value based on device type

	var changeSettings = function() {

		if (MRAID.ios && Settings["target-url"]["ios"]) Settings["target-url"] = Settings["target-url"]["ios"];
		else if (MRAID.android && Settings["target-url"]["android"]) Settings["target-url"] = Settings["target-url"]["android"];
		else if (MRAID.amazon && Settings["target-url"]["amazon"]) Settings["target-url"] = Settings["target-url"]["amazon"];
		else if (Settings["target-url"]["default"]) Settings["target-url"] = Settings["target-url"]["default"];
		else Settings["target-url"] = Settings["target-url"]["ios"] || Settings["target-url"]["android"] || Settings["target-url"]["amazon"] || Settings["target-url"]["default"] || (typeof Settings["target-url"] === "string" ? Settings["target-url"] : "");

	};

	if (MRAID.TrackedEvents["Loader Initialized"]) changeSettings();
	else Broadcast.on("Loader Initialized", changeSettings, "release-integration-script-3");

})();
